import React from 'react';
import './CSS/shared.css';
import './CSS/home.css';
import professional_photo from './Images/professional_photo.jpg'
import NavigationBarComponent from './JS/navigation-bar.jsx'

function App() {
  return (
    <div>
      <NavigationBarComponent/>
      <div className="intro__container">
        <div className="intro__photo-container">
          <img className="intro__photo" src={professional_photo} alt=""/>
        </div>
        <div className="intro__text-circle-container">
          <h1>Hello World.</h1>
          <p>Texas A&M Computer Science student with two years of industry experience</p>
        </div>
      </div>
    </div>
  );
}

export default App;
